import React from "react";
import { Box, Typography, Button } from "@material-ui/core";

const HeroBanner = () => {
  return (
    <div>
      <Box component="div">
        <Typography>
          Hello, I am <span>NAME</span>
        </Typography>
        <Typography>
          I am a Web Developer with Expertise in TECHNOLOGY
        </Typography>
        <Button variant="contained">Visit Portfolio</Button>
      </Box>
      <Box></Box>
    </div>
  );
};

export default HeroBanner;
